import Link from 'next/link';
import '../static/styles/index.css'

class LandingPage extends React.Component {
    render() {
        return (
            <div className="background">
                <button>
                    <Link href="/dealer">
                        <a>Dealer</a>
                    </Link>
                </button>
                <button>
                    <Link href="/customer">
                        <a>Customer</a>                    
                    </Link>
                </button>
            </div>
        );
    }
}

export default LandingPage;
